import React from "react";
import caloriesIcon from "../assets/calories-icon.png";
import proteinIcon from "../assets/protein-icon.png";
import carbsIcon from "../assets/carbs-icon.png";
import fatIcon from "../assets/fat-icon.png";
import "../styles/cards.css";

const KpiCards = ({ data }) => {
  if (!data) return null;

  return (
    <div className="kpi-cards">
      <div className="kpi-card">
        <img src={caloriesIcon} alt="Calories" />
        <div>
          <h3>{data.calorieCount}kCal</h3>
          <p>Calories</p>
        </div>
      </div>

      <div className="kpi-card">
        <img src={proteinIcon} alt="Protéines" />
        <div>
          <h3>{data.proteinCount}g</h3>
          <p>Protéines</p>
        </div>
      </div>

      <div className="kpi-card">
        <img src={carbsIcon} alt="Glucides" />
        <div>
          <h3>{data.carbohydrateCount}g</h3>
          <p>Glucides</p>
        </div>
      </div>

      <div className="kpi-card">
        <img src={fatIcon} alt="Lipides" />
        <div>
          <h3>{data.lipidCount}g</h3>
          <p>Lipides</p>
        </div>
      </div>
    </div>
  );
};

export default KpiCards;
